// Quotient ring basis (V) = x1,x2,x3,x4,
// Available monomials (RR*V) = x1^3,x1^2*x2,x1^2*x3,x1^2*x4,x1,x2,x3,x4,

void mexFunction(int nlhs, mxArray *plhs[], int nrhs, const mxArray *prhs[])
{
	if (nrhs != 1) {
		mexErrMsgIdAndTxt("automatic_generator_cvpr:gcam_sift_3inter:nrhs", "One input required.");
	}
	if (nlhs != 1) {
		mexErrMsgIdAndTxt("automatic_generator_cvpr:gcam_sift_3inter:nlhs", "One output required.");
	}    
	if (!mxIsDouble(prhs[0]) || mxIsComplex(prhs[0])) {
		mexErrMsgIdAndTxt("automatic_generator_cvpr:gcam_sift_3inter:notDouble", "Input data must be type double.");
	}
	if(mxGetNumberOfElements(prhs[0]) % 39 != 0) {
		mexErrMsgIdAndTxt("automatic_generator_cvpr:gcam_sift_3inter:incorrectSize", "Input size must be multiple of 39.");
	}
	int n_instances = mxGetNumberOfElements(prhs[0]) / 39;
	double *input = mxGetPr(prhs[0]);
	plhs[0] = mxCreateDoubleMatrix(7,4*n_instances,mxCOMPLEX);
	double* zr = mxGetPr(plhs[0]);
	double* zi = mxGetPi(plhs[0]);
	for(int k = 0; k < n_instances; k++) {
		const VectorXd data = Map<const VectorXd>(input + k*39, 39);
		MatrixXcd sols = solver_gcam_sift_3inter(data);
		Index offset = k*sols.size();
		for (Index i = 0; i < sols.size(); i++) {
			zr[i+offset] = sols(i).real();
			zi[i+offset] = sols(i).imag();
		}
	}
}
